contracts/ManageVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract ManagedVault {
    address public owner;

    // Mapping to keep track of deposits by user for return functionality
    mapping(address => uint256) public nativeDeposits;
    mapping(address => mapping(address => uint256)) public tokenDeposits;

    // Events for logging deposits and withdrawals
    event Deposit(address indexed from, uint256 amount, address token);
    event Withdrawal(address indexed to, uint256 amount, address token);

    constructor() {
        owner = msg.sender;  // Set contract deployer as owner
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    // Function to deposit native token (e.g., ETH on Ethereum, BNB on BSC)
    function depositNative() external payable {
        require(msg.value > 0, "Must send some native token");
        nativeDeposits[msg.sender] += msg.value;
        emit Deposit(msg.sender, msg.value, address(0)); // address(0) represents native token
    }

    // Function to deposit an ERC-20 token
    function depositERC20(address tokenAddress, uint256 amount) external {
        IERC20 token = IERC20(tokenAddress);
        require(token.transferFrom(msg.sender, address(this), amount), "Transfer failed");
        tokenDeposits[msg.sender][tokenAddress] += amount;
        emit Deposit(msg.sender, amount, tokenAddress);
    }

    // Function to release native tokens to a specified address
    function releaseNative(address payable to, uint256 amount) external onlyOwner {
        require(address(this).balance >= amount, "Insufficient balance");
        to.transfer(amount);
        emit Withdrawal(to, amount, address(0));
    }

    // Function to release ERC-20 tokens to a specified address
    function releaseERC20(address tokenAddress, address to, uint256 amount) external onlyOwner {
        IERC20 token = IERC20(tokenAddress);
        require(token.balanceOf(address(this)) >= amount, "Insufficient token balance");
        require(token.transfer(to, amount), "Transfer failed");
        emit Withdrawal(to, amount, tokenAddress);
    }

    // Function to return native token to the original depositor
    function returnNative() external {
        uint256 amount = nativeDeposits[msg.sender];
        require(amount > 0, "No deposit to return");
        nativeDeposits[msg.sender] = 0; // Clear deposit balance
        payable(msg.sender).transfer(amount);
        emit Withdrawal(msg.sender, amount, address(0));
    }

    // Function to return ERC-20 token to the original depositor
    function returnERC20(address tokenAddress) external {
        uint256 amount = tokenDeposits[msg.sender][tokenAddress];
        require(amount > 0, "No token deposit to return");
        tokenDeposits[msg.sender][tokenAddress] = 0; // Clear deposit balance
        IERC20(tokenAddress).transfer(msg.sender, amount);
        emit Withdrawal(msg.sender, amount, tokenAddress);
    }

    // Functions to view balances
    function getNativeBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function getTokenBalance(address tokenAddress) external view returns (uint256) {
        IERC20 token = IERC20(tokenAddress);
        return token.balanceOf(address(this));
    }
}

